'''Ashikaga Yoshitane''' ([[tiếng Nhật]]: 足利 義稙; [[9 tháng 9]] năm [[1466]] — [[23 tháng 5]] năm [[1523]]), nguyên danh '''Ashikaga Yoshiki''' (足利 義材), là [[shōgun|shogun]] thứ 10 của [[Mạc phủ Ashikaga]] ở [[Nhật Bản]], nắm quyền từ năm [[1490]] đến năm [[1495]]<ref>Titsigh, Issac. (1834). {{Google books|18oNAAAAIAAJ|''Annales des empereurs du japon,'' p. 361–362.|page= 361}}</ref> và năm [[1508]] đến năm [[1521]].<ref>Titsingh, {{Google books|18oNAAAAIAAJ|pp. 367–371.|page= 367}}</ref>

